const int INF = 1e9 + 100;
const double EPS = 1e-10;
const int MOD = 1e9 + 7;
const int MAXN = 2e5 + 100;

string s, t;
int ps[MAXN][26], pt[MAXN][26];
string ans;

bool check(int l1, int r1, int l2, int r2) {
    for (int i = 0; i < 26; ++i) {
        if (ps[r1 + 1][i] - ps[l1][i] != pt[r2 + 1][i] - pt[l2][i]) {
            return false;
        }
    }
    return true;
}

bool rec(int l1, int r1, int l2, int r2) {
    if (l1 == r1) {
        return s[l1] == t[l2];
    }

    int mid1 = (l1 + r1) / 2;
    int mid2 = (l2 + r2) / 2;
    if (check(l1, mid1, l2, mid2) && check(mid1 + 1, r1, mid2 + 1, r2)) {
        if (rec(l1, mid1, l2, mid2) && rec(mid1 + 1, r1, mid2 + 1, r2)) {
            ans += "0 ";
            return true;
        }
    }
    if (check(l1, mid1, mid2 + 1, r2) && check(mid1 + 1, r1, l2, mid2)) {
        if (rec(l1, mid1, mid2 + 1, r2) && rec(mid1 + 1, r1, l2, mid2)) {
            ans += "1 ";
            return true;
        }
    }
    return false;
}

inline void solve() {
    cin >> s >> t;

    for (int j = 0; j < 26; ++j) {
        ps[0][j] = pt[0][j] = 0;
    }
    ans.clear();
    for (int i = 0; i < s.size(); ++i) {
        for (int j = 0; j < 26; ++j) {
            ps[i + 1][j] = ps[i][j] + (s[i] - 'a' == j);
            pt[i + 1][j] = pt[i][j] + (t[i] - 'a' == j);
        }
    }

    if (rec(0, (int)s.size() - 1, 0, (int)t.size() - 1)) {
        cout << "Yes\n";
        cout << ans << '\n';
    } else {
        cout << "No\n";
    }
}

