import { LitElement,html } from 'lit';
import { customElement,property } from 'lit/decorators.js';
import {Task} from '@lit/task';
import DnsRecord from "./types/dns"

@customElement('dns-entry')
class DnsEntry extends LitElement {
  @property()
  public entryid?: string;

  public _entryId() {
    return this.entryid
  }
  private _entryTask = new Task(this, {
    task: async ([entryId], {signal}) => {
      const response = await fetch(`http://dns.api.entitywind.io/${this.entryid}`, {signal});
      if (!response.ok) { throw new Error(`${response.status}`); }
      return await response.json() as Promise<DnsRecord>
    },
    args: () => [this._entryId()]
  });

  render() {
    return this._entryTask.render({
      pending: () => html`<p>Loading dns record...</p>`,
      complete: (dnsRecord) => html`
        <ul>
          <li>${dnsRecord.domain}</li>
          <li>${dnsRecord.ttl}</li>
          <li>${dnsRecord.class}</li>
          <li>${dnsRecord.recordType}</li>
          <li>${dnsRecord.record}</li>
        </ul>
        `,
      error: (e) => html`<p>Error: ${e}</p>`
    });
  }
}

function solve(parameters) {
    const movies = []
    const checks = ["addMovie","directedBy","onDate"]

    const splitConditions = {
        "addMovie": param => [param.split("addMovie ")[1]],
        "directedBy": param => param.split(" directedBy "),
        "onDate": param => param.split(" onDate "),
    }

    const actions = {
        "addMovie": movie => movies.push({"name": movie}),
        "directedBy": (movie,director) => {
            movie = movies.find(mov => mov.name === movie)
            if (movie){
                movie.director = director
            }
        },
        "onDate": (movie,date) =>{
            movie = movies.find(mov => mov.name === movie)
            if (movie){
                movie.date = date
            }
        }
    }

    for (const param of parameters){
        for (let check of checks){

            if (param.includes(check)){
                let values = splitConditions[check](param)
                actions[check](...values)
                break
            }
        }
    }

    movies.forEach(movie => {
        if (Object.keys(movie).length === 3) console.log(JSON.stringify(movie))
    })

}

