int gen_rand(int a, int b) {
	return rand() % (b + 1 - a) + a;
}

void gen_randarr(int size, int arr[], int a, int b) {
	for (int k = 0; k < size; k++) {
		arr[k] = gen_rand(a, b);
	}
}

int get_max(int size, int arr[]) {
	int max = arr[0];
	for (int k = 1; k < size; k++) {
		if (max < arr[k]) {
			max = arr[k];
		}
	}
	return max;
}

int get_maxid(int size, int arr[]) {
	int max = arr[0];
	int maxid = 0;
	for (int k = 1; k < size; k++) {
		if (max < arr[k]) {
			max = arr[k];
			maxid = k;
		}
	}
	return maxid;
}

int get_minid(int size, int arr[]) {
	int min = arr[0];
	int minid = 0;
	for (int k = 1; k < size; k++) {
		if (min > arr[k]) {
			min = arr[k];
			minid = k;
		}
	}
	return minid;
}

int find_val(int size, int arr[], int val) {
	//int idval = -1;
	for (int k = 0; k < size; k++) {
		if (arr[k] == val) {
			//idval = k;
			return k;  // return idval; 
		}
	}
	return -1; // return idval;
}


void show_minmax(int size, int arr[]) {
	int max = arr[0];
	int min = arr[0];
	int idmax = 0;
	int idmin = 0;
	
	for (int k = 1; k < size; k++) {
		if (max < arr[k]) {
			max = arr[k];
			idmax = k;
		}

		if (min > arr[k]) {
			min = arr[k];
			idmin = k;
		}
	}	

	cout << "max in " << idmax+1 << " equal " << max << endl;
	cout << "min in " << idmin+1 << " equal " << min << endl;
}

int get_min(int size, int arr[]) {
	int min = arr[0];
	for (int k = 1; k < size; k++) {
		if (min > arr[k]) {
			min = arr[k];
		}
	}
	return min;
}

